Report in this item any fees paid/payable by the entity for administration services provided to the entity. May include (but is not limited to):
* All internal or outsourced administration costs (unless these are charged directly to the employer or union sponsor);
* Administration fees charged by/paid to the employer sponsor for services rendered to the entity;
* Expenses incurred to administer switches of members' investment choices (but not investment manager fees or other investment expenses); and
* Employee costs such as salaries and on-costs for direct employees of the entity.
Exclude fees for the following in this item
* Investment management services;
* Custodian fees; and
* Directors/Trustee remuneration and expenses.

Report all costs relating to an investment in direct property. Includes (but is not limited to):
* Repairs and maintenance;
* Ongoing running costs;
* Property management fees;
* Valuation fees; and
* Stamp duty.
